import React from 'react';
import logo from './logo.svg';
import './App.css';

const testData = [{
ID:"324",
  Name: "gilad",
},
{
  ID:"323444",
    Name: "or",
  }]
const TableHeader = ()=>{
  return (
  <tr>
    <td> ID</td>
    <td> Name</td>
  </tr>)
}

const OneCient = (props)=>{
  return (
  <tr>
    <td>{ props.ID}</td>
    <td> { props.Name}</td>
  </tr>)
}
const TableValues = (props)=>{
 return(props.clients.map(client =><OneCient {...client}/>));
}

function App() {
  const [readClients, setReadClients] = useState(testData);
  return (
    <div className="App">
      <header className="App-header">
        <table  border="1">
          <TableHeader/>
          <TableValues clients = {readClients}/>
        </table>
      </header>
    </div>
  );
}

export default App;
